[{'def': 'id est, Medicina.', 'entry_id': 'Ruland1612-Elixir,-Elei,', 'raw': 'id est, Medicina.', 'sense_idx': 1, 'translations': array([], dtype=object)}
 {'def': 'est fermentum, cuius minima quantitas sui generis ingentem molem in pastam sibi similem penetrando conglutinat', 'entry_id': 'Ruland1612-Elixir', 'raw': 'est fermentum, cuius minima quantitas sui generis ingentem molem in pastam sibi similem penetrando conglutinat. Pasta h. I. est spiritus vitę hominum, internusque vitae balsamus: est interna corporis conseruattix in eo statu, in quo illud reperit. Elixir autem externus arte balsamus ab externis conquisitus ac praeparatus in spagiricum fermentum. Vel:', 'sense_idx': 1, 'translations': array([], dtype=object)}
 {'def': 'est species ex pluribus diuersi generis simplicium specieb. composita.', 'entry_id': 'Ruland1612-Elixir', 'raw': 'est species ex pluribus diuersi generis simplicium specieb. composita. Itaque cum oleum terebinthi componitur cum floribus sulphuris, & oleo myrrhae: quando quintae vini essentiae miscetur tinctura croci: magisteria vegetabilium mineralib. seu magisteriis, seu essentiis, seu extractis aliis, & similia coadunantur, in medicinam compositam, elixir vocatur. Potissimum tamen excellunt elixyria liquida, quae forma sua repraesentant aquas bezoardicas, aliasque stillatitias compositas, quib. & ob cognationem nomen communicatur. Aliis elixyr distat ab omnib. aliis essentiis, quia fiat ex plurib. & detur vel ad sanitatem in eodem statu detinendam, vel ad iminentes morbos arcendos, praeseruandumque a putredine. Vel:', 'sense_idx': 1, 'translations': array([], dtype=object)}
 {'def': None, 'entry_id': 'Ruland1612-Elixir', 'raw': 'ist das ferment, Vrheb Deyssendi Sawrteig / ist dassso auß Wasser wirdt. Dann Yxir ist Wasser / es ist ein gefaͤrbet Wasser gemenget mit den Coͤrpern / ist auch der weisse SteinOli vnd Puluer / dann das ist alles ein Ding / heist auch der Sehatz heist auch prima materia, st imperfect Elixit, wans Q perfect und bereit ist/ so ist es freylich ein Schatz. Lacinius spricht: Elixir wirdt gemacht auß dreyen / Sole, Luna, vnd Mercurio. Es soll aber mittelmessig sein zwischen hart vund weichlweicher und submer alß Mercuns, sonst das Goldso darauß gemacht/ist ongeschmeidig. auß dem Elixir wirdt Azot, vund ist das erste Theil deß Wercks. Also ist das Elixir zweyerleysweiß vuͤrot Wannsrot ist/setzet man das ferment Vel: zu vnd wirdt multiplicirt.', 'sense_idx': 1, 'translations': array([{'quote': 'ist das ferment, Vrheb Deyssendi Sawrteig / ist dassso auß Wasser wirdt. Dann Yxir ist Wasser / es ist ein gefaͤrbet Wasser gemenget mit den Coͤrpern / ist auch der weisse SteinOli vnd Puluer / dann das ist alles ein Ding / heist auch der Sehatz heist auch prima materia, st imperfect Elixit, wans Q perfect und bereit ist/ so ist es freylich ein Schatz. Lacinius spricht: Elixir wirdt gemacht auß dreyen / Sole, Luna, vnd Mercurio. Es soll aber mittelmessig sein zwischen hart vund weichlweicher und submer alß Mercuns, sonst das Goldso darauß gemacht/ist ongeschmeidig. auß dem Elixir wirdt Azot, vund ist das erste Theil deß Wercks. Also ist das Elixir zweyerleysweiß vuͤrot Wannsrot ist/setzet man das', 'type': 'translation', 'xml_lang': 'de'},
        {'quote': 'zu vnd wirdt multiplicirt.', 'type': 'translation', 'xml_lang': 'de'}],
       dtype=object)}
 {'def': 'Ist eine durchdringende Artzney / vund wirdt gemacht von den vegetabilibus, id est, quatuor spiritibus, mit Zuthuung eines corporis, welches corpus ist ein ferment einer Artzney.', 'entry_id': 'Ruland1612-Elixir-vel-Xir', 'raw': 'Ist eine durchdringende Artzney / vund wirdt gemacht von den vegetabilibus, id est, quatuor spiritibus, mit Zuthuung eines corporis, welches corpus ist ein ferment einer Artzney.', 'sense_idx': 1, 'translations': array([{'quote': 'Ist eine durchdringende Artzney / vund wirdt gemacht von den vegetabilibus, id est, quatuor spiritibus, mit Zuthuung eines corporis, welches corpus ist ein ferment einer Artzney.', 'type': 'translation', 'xml_lang': 'de'}],
       dtype=object)}                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 ]

