 {'def': 'est maturatio simplex, qua in calore digestorio res inconcoctae digeruntur. Id enim est digerere, ad modum digestionis naturalis ciborum in ventriculo, competente cuiuis calore, concoquere, & dispositum ad vim exserendam reddere. Ita etiam intractabilia digeredo euadunt operibus apta & mitiora: Et si quid inest semicoctum, perducitur ad partium absolutarum conditionem, vt postea eo abundantior sit essentiae messis. Hoc nomine digestio inseruit nonnunquam elaborationibus: & alio vocabulo etiam, Maceratio appellatur. Apud Mesuem etiam Nutritio, (veluti cum scoria dicitur diu aceto nutriri, pro macerari. Immitis enim pars, seu succus quasi edomatur, vt mitis fiat, & non tantum essentiam augeat, sed & facile abstrahi a faecibus inertibus possit. Nam maceratio quandam vim habet penetrandi, re serandi, & ab impuritatibus liberandi. Vel:', 'entry_id': 'Ruland1612-Digestio', 'raw': 'est maturatio simplex, qua in calore digestorio res inconcoctae digeruntur. Id enim est digerere, ad modum digestionis naturalis ciborum in ventriculo, competente cuiuis calore, concoquere, & dispositum ad vim exserendam reddere. Ita etiam intractabilia digeredo euadunt operibus apta & mitiora: Et si quid inest semicoctum, perducitur ad partium absolutarum conditionem, vt postea eo abundantior sit essentiae messis. Hoc nomine digestio inseruit nonnunquam elaborationibus: & alio vocabulo etiam, Maceratio appellatur. Apud Mesuem etiam Nutritio, (veluti cum scoria dicitur diu aceto nutriri, pro macerari. Immitis enim pars, seu succus quasi edomatur, vt mitis fiat, & non tantum essentiam augeat, sed & facile abstrahi a faecibus inertibus possit. Nam maceratio quandam vim habet penetrandi, re serandi, & ab impuritatibus liberandi. Vel:', 'sense_idx': 1, 'translations': array([], dtype=object)}
