[{'def': 'est misti resolutio per putredinem naturalem in calido humido', 'entry_id': 'Ruland1612-Putrefactio', 'raw': 'est misti resolutio per putredinem naturalem in calido humido. Humorem enim necesse est vincere terminans siccum, agente calore externo: quo facto, calor cognatus cum humido suo substantiali segregatur à commistis & homogeneiam suam seruat, consistens seorsim. Itaque si res putrefacienda humore abundat, comminuta in illo ipso sinitur & ponitur ad digestionem simi vel balnei calidam, foris scil. adhibito calore humido. Sin ipsa per se parum humoris habet, aut nihil, teritur & proportionali humore conspergitur, inque suo vase ad putrescendum locatur.', 'sense_idx': 1, 'translations': array([], dtype=object)}
 {'def': 'alia est ambigens inter calcinationem corrosiuam, & putrefactionem, vocaturque putrefactio sicca & Philosophica. Imo à quibus libet nomen habet, cum quibus aliqua ratione consentit, vt sublimatio, separatio elementorum, coctio, solutio, &c. Fit autem in aqua Philosophorum sicca, seu aceto acerrime, nec est alius rei nasolis & Lunae.', 'entry_id': 'Ruland1612-Putrefactio', 'raw': 'alia est ambigens inter calcinationem corrosiuam, & putrefactionem, vocaturque putrefactio sicca & Philosophica. Imo à quibus libet nomen habet, cum quibus aliqua ratione consentit, vt sublimatio, separatio elementorum, coctio, solutio, &c. Fit autem in aqua Philosophorum sicca, seu aceto acerrime, nec est alius rei nasolis & Lunae.', 'sense_idx': 1, 'translations': array([], dtype=object)}
 {'def': 'est digestio, substantiam rei ex vaporum retentione, calidi externi accessione ad rem praestantiorem generandam dissoluens. Est autem putrefactioni proprium veterem naturam rerum consumere, nouam introducere, & nonnunquam producere fructum alterius generationis.', 'entry_id': 'Ruland1612-Putrefactio', 'raw': 'est digestio, substantiam rei ex vaporum retentione, calidi externi accessione ad rem praestantiorem generandam dissoluens. Est autem putrefactioni proprium veterem naturam rerum consumere, nouam introducere, & nonnunquam producere fructum alterius generationis. Spiritus etiam corrosiui per eam dulcescunt atque mitescunt, omnes colores in alios immutantur: item purum ab impuro (impuro subsidente deorsum) separatur. Fit vero materia in vase collocata, vas in fimum ponitur, fimique calor ad tempus praefixum conseruatur. Satius autem est vas in balneum roris collocari.', 'sense_idx': 1, 'translations': array([], dtype=object)}
 {'def': 'Faͤulung ist wan es schwartz wird als dann stincktes auch wie ein Mist ond Aaß /ond hie geschicht die ware solutio corporis, da werden die Element zertrennet vnd verstoͤhret sals die onter vund in einander wircken vund leiden. Das gibt die mancherley Farben / biß der Sig erhalten vund alles wider vereiniget wirdt.', 'entry_id': 'Ruland1612-Putrefactio', 'raw': 'Faͤulung ist wan es schwartz wird als dann stincktes auch wie ein Mist ond Aaß /ond hie geschicht die ware solutio corporis, da werden die Element zertrennet vnd verstoͤhret sals die onter vund in einander wircken vund leiden. Das gibt die mancherley Farben / biß der Sig erhalten vund alles wider vereiniget wirdt.', 'sense_idx': 1, 'translations': array([{'quote': 'Faͤulung ist wan es schwartz wird als dann stincktes auch wie ein Mist ond Aaß /ond hie geschicht die ware solutio corporis, da werden die Element zertrennet vnd verstoͤhret sals die onter vund in einander wircken vund leiden. Das gibt die mancherley Farben / biß der Sig erhalten vund alles wider vereiniget wirdt.', 'type': 'translation', 'xml_lang': 'de'}],
