 {'entry_id': 'Ruland1612-Sulphur', 'quote': 'ist der Saam dieses steins / ond ist zweyerley ein eusserlicher / dadurch der innerlich im Mercurio gebohren wirdis der ist ire disch vund verbrennlich onnuͤtz wird weggethan wie das Menstrualische Wasser von dem Kind. Der innerlich ist die Krafft/die den Coͤrper macht ond zubereitet sonnd kann nit davon gescheiden werden / denn es ist congenitum ahngebohrem in der Wurzelsond Substanz /ond ist anfaͤnglich weiß wirde rohr durch die Hitz / als die Speisen im Magen durch die Lebersso ist der Schwefel Meister worden / ond ist forma rei, die Seel/ond ist das Ferment in diesem Stein der Mann Koͤnig ond Breutgam wird genennt rohr arsenic, gebrent Eschen lonser Gold Philosophisch Gold/ Dley Goldbluͤsein truckt steinern wasser Fewr Erdlein roter Stein coagulum B, vum tinetur. 456 LEXICON ALCHEMIAE MART. Der gemeine Schwefel / oder Sulphur / werde genennet wie er woͤlle / so ist er ond bleibt ein Feindt aller Metallen zerstoͤhrett schwaͤrtzet /onnd verderbet / aber der Philosophisch Sulphur ist Lebesmachend / zeitiget ound erstattet allen Mangellschwaͤrtzetsonnd verderbet nichts/ wirdt Sulphur genennet Gleichnuß weiß darumb wirdter nirgendt funden als in den perfecten Coͤrpern. Tercusc. in epistol. Im Metall ist zweyer ey Sck wefel seirs kan abgesondert werden / das ander nicht / wie im Menschen ist zweyerley Blut- Rein das kanzu Fleisch werden / vund das ander so durch den Schweis weg gehet. Der wesentliche Sulphur ist eine reine Wirckung der Lufftlond deß Fewers welches sein proportionirte / ond gleich formige Erd / vund Wasser waͤrme digerirt/onnd kochet in eim Mercurio. Turba, das Schwefelisch Wasser ist ein auffgeloͤset Goldsein lebenmachend Wasserfrein vnd onverbrennlich Philosophisch Gold / wird funden in Sole vund Luna.', 'type': 'translation', 'xml_lang': 'de'}
