 {'def': 'esta', 'entry_id': 'Ruland1612-Tinctura', 'raw': 'esta: canum specificum cum essentia qualitatibusque formalibus etiam colorem rei habens, vt in sui similem naturam tingere possit. Haec si optime elaborata est, in valde tenui perspicua substantia apparet, tanquam esset aer perspicuus quidem & purus, at coloratus certo modo, colore perspicuitatem non prohibente. Itaque & sine sedimento longo tempore durare potest. Neque vero tam elaborandi gratia: petitur, quam efficaciter ad sui naturam immutandi, quantum dispositio rei patitur. Itaque in medicina plurimum ad valetudinis restaurationem, & sanitatem firmandam adhibetur, ita vt ob validam virtutem etiam renouandi potestatem habere dicatur, cum omnia membra, sanguinem, spiritum & calorem reddat vsu sui vegetum & valentem.', 'sense_idx': 1, 'translations': array([], dtype=object)}
 {'def': 'est duplex', 'entry_id': 'Ruland1612-Tinctura', 'raw': 'est duplex: Aperta & productae: Aperta est, quae in superficie sponte naturae se conspiciendam offert: qualis est frequens in mineralibus.', 'sense_idx': 1, 'translations': array([], dtype=object)}
 {'def': 'producta est, quae a centro ad superficiem producitur RVLANDI PHIL', 'entry_id': 'Ruland1612-Tinctura', 'raw': 'producta est, quae a centro ad superficiem producitur RVLANDI PHIL. ET MEDICI. 475 & extrahitur. In plerisque enim aliis in occulto recessu color, virtusque est, quod alias dicunt in potentia esse, vnde per exaltationum modos est producenda; antequam extrahatur. Nobilissimae hic sunt tincturae metallorum, quaedam esiam in vegetabilium censu reperiuntur.', 'sense_idx': 1, 'translations': array([], dtype=object)}]

