 {'def': 'seu eleuatio humida recta est, qua partes humidę sub tiliores in aethera eleuatae, & frigidis alembici cameris adhae- 188 RVLANDI PHILOS', 'entry_id': 'Ruland1612-Distillatio', 'raw': 'seu eleuatio humida recta est, qua partes humidę sub tiliores in aethera eleuatae, & frigidis alembici cameris adhae- 188 RVLANDI PHILOS. ET MEDICI. rescentes in humorem condensantur, atque per eiusdem canalem guttatim in appositum vas destillant ac dilabuntur. Fit autem illa hoc pacto: Materia, distillanda inditur cucurbitae non minus altae sed satis amplae, (altitudo enim vasis artificem detinet, quem amplitudo inuat) & imponitur alembicus magnus, qui spiritus ascendentes facilius capiat, & in humorem resoluat. Postea pro ratione rei eleuandae, ad calorem adaequatum ponitur, apposito receptaculo humorem dilabente accipiente, omnibusque quam iuncturis probe clausis ignis accensus secundum gradus adhibetur, eo vsque, quo omnis humiditas alembicum descenderit. Exemplum a vegetalibus producemus. Rosis recentibus impleo cucurbitam ad tertiam partem, illamque in balneo maris pono, aqua adhuc frigida; postea alembicum rosarRub. foliis, quibus aculei lutei decerpti sunt, compleo, cucurbitae…', 'sense_idx': 1, 'translations': array([], dtype=object)}
 {'def': '& eleuatiohumida obliqua, est quando vase oblique iacente humor eleuatur', 'entry_id': 'Ruland1612-Distillatio', 'raw': '& eleuatiohumida obliqua, est quando vase oblique iacente humor eleuatur. Fit autem hoc vel per latus, vel per retortara.', 'sense_idx': 1, 'translations': array([], dtype=object)}]

