[{'def': 'Sedeneg Arabice, à German', 'entry_id': 'Ruland1612-Haematites', 'raw': 'Sedeneg Arabice, à German. Blutstein, propter colorem sanguineum, quo tingit, & etiam spectatur praecipae, qui fossilis est in fodinis, & propter effectum etiam, quem habet in sistendo sanguine, in omni fluxu sanguineo. Plinius varias eius species facit. Est n. haematites diuersus secundum regionum natales, in Lybia, Aegypto, & Hispania, & in Cheruscis Northusiae: Item Hattesgerodae, in Saxonia Goselariae, in Iudetis montibus Annaebergo & Geuro, ad Salam, Salfeldiae, Salburgiae, lenae. Est & diuersus haematites, si mollitiem & duritiem eius consideras. Sunt ergo hae eius species mihi notae.', 'sense_idx': 1, 'translations': array([{'quote': 'Blutstein', 'type': 'translation', 'xml_lang': 'de'}],
       dtype=object)}
 {'def': '1', 'entry_id': 'Ruland1612-Haematites', 'raw': '1. Fossilis, qui celebratur a Diosc. l. 5. c. 90. cuius patria Aegyptus est. Niger, colore saturato, durus, friabilis, suo ingenio aequalis, nulla sorde admixta, nulloque zonarum discursu. Haec prima species inter fossiles haematites nostros reperitur, sed rarissime vix vnum & alterum vidi, vulgo alias omnino ignotus. 2. Niger reperitur Gossariae, reddens succum croceum: durissimus, incognitus etiam officinis. Reperitur & is, licet raro ad Hercyniam syluam in Cheruscis. Estque procul dubiogemma seu lapis Alberti Medus niger, qui tritus reddit croceum succum. Cuius altera species viridis. Dicitur autem Medus, quia a Medorum regione adfertur, & reperitur ad Phasin. 3. Fossilis in Hassia, multis in locis reperitur, qui purpureus fissilis seu scissilis. 4. Fossilis pulcerrimus nascitur in Geuro & Annebergo, Salfeldiae. Hunc laudant aurifabri, quod sit ad contem durissimus, ad gemmas poliendas. Niger est, & quasi turbinatus. RVLANDI PHIL. ET MEDICI. 251 5. Fossilis reperitur in iisdem loci…', 'sense_idx': 1, 'translations': array([], dtype=object)}
 {'def': 'Plinii', 'entry_id': 'Ruland1612-Haematites', 'raw': 'Plinii. 1. Aethiopicus, vtilissimus oculis, ex iis, quos vocant panchrestas. Hunc idem Plin. l. eod. c. 16. haematitem magnem vocat. Et reperiri eum dicit in Aethiopia, vbi fit magnes ipse Aethiopicus. Est vero iuxta eundem hic sanguinei coloris. Si teratur, sanguineum & croceum reddit succum, sed tamen ferrum non attrahit, vt magnes. Et profecto est magna cognatio magnetis & haematitis. Ex magnete vellementer calore ambusto fiunt haematites. 2. Androdamanta, vel atrodamanta, duritia ac pondere insignis. Vnde & nomen inuenit, coloris nigri, praecipue in Africa inuenitur, trahens ad se ferrum, reddens succum sanguineum. Huic respondet plurimum noster haematites, quam reperit in Geuro durissimus ad contem, qui est trichrus. 3. Arabicus, durus, vix reddens succum adcotem aquariam, aliquando croco similem. Huic noster respondet, qui reperitur Gossariae, & ad Hercyniam syluam. 4. Elatites, cum crudus est. Coctus autem dicitur miles. Vtilis ambustis, ad omnia vtilior rubrica. 5. Schistos, c…', 'sense_idx': 1, 'translations': array([], dtype=object)}]

