[{'def': 'est species Chymica ex toto citra extractionem, impuritatibus duntaxat externis ablatis elaborata, exaltataque.', 'entry_id': 'Ruland1612-Magisterium', 'raw': 'est species Chymica ex toto citra extractionem, impuritatibus duntaxat externis ablatis elaborata, exaltataque. Seruantur itaque hic omnes concretionis naturalis & Homogeneae partes. Sed ita exaltantur, vt dignitatem essentiarum prope attingant. Vnde & pene eadem relinquitur quantitas seu moles, quam natura per se dedit: quanquam non semper caueri possit, quin cum alienitatibus & foris adhaerentibus nonnihil secedat: & nonnunquam etiam studio propter finem, vsumque certum quidam negligitur: ex quibus intelligitur maxime hic valere, quam Physici alterationem nuncupant.', 'sense_idx': 1, 'translations': array([], dtype=object)}
 {'def': 'aliud est qualitatis, aliud substantiae.', 'entry_id': 'Ruland1612-Magisterium', 'raw': 'aliud est qualitatis, aliud substantiae.', 'sense_idx': 1, 'translations': array([], dtype=object)}
 {'def': 'fixorum est, cum corpora volatilia & spirituosa figuntur ad constantiam', 'entry_id': 'Ruland1612-Magisterium', 'raw': 'fixorum est, cum corpora volatilia & spirituosa figuntur ad constantiam. Fixum opponitur inconstanti & volatili, & aestimatur vtrumque proprie ad ignem: cuius vim, quod sustinet, fixum est; quod non, volatile: siquidem ex eo fugit, & veluti spiritus aut fauilla euolat. Illi vicinum est, quod e molli induratur: Itaque & hoc eodem comprehenditur titulo.', 'sense_idx': 1, 'translations': array([], dtype=object)}]

[{'def': 'id est, sulphur.', 'entry_id': 'Ruland1612-Mercurius', 'raw': 'id est, sulphur. Mercurius. Mercurius ist in allen Chymistischen Buͤchern vorn ondhindenser hat allesgethan macht jedermann viel zuschaffen/greifft manchem dieff in Seckel ond in das Gehirn. So ist nun Mercurius ein zaͤhschleimiche Wassersklebt doch nichtl Dann es ist truckner Natur / feucht warml es ist Wasser mit Erden ganz vest onzertrennlich vermenget / also das sie entweder bey einander verbleiben oder mit einander verschwinden. 2. Specul. alchim. sagi Mercurius: istlebendig Gold fol. 23. ercoͤdtet vnd machet lebendig feuchtet vund truͤcknet / waͤrmet ond kuͤhtet wuͤrcket widerwertige Ding nach der Maß seines Regimente. 3. Heisset auch Essig soli, ein Vatter aller wunder Dingi LEXICON ALCHEMIAE MART. 332 vund die hoͤchste Artzney / lebendig Silber / dieweil er ein Seei hat Item / daß Badt / ein bestaͤndig bleibendt Wasser / aqua sulphuris, ein brennendt Wasser / Wasser deß Lebens, deß Golds! deß Salniters / rein Wasser weiß Kaͤller / KaroDampffl Samen Schaten (fewrig GiffelFeiwr …', 'sense_idx': 1, 'translations': array([{'quote': 'Mercurius ist in allen Chymistischen Buͤchern vorn ondhindenser hat allesgethan macht jedermann viel zuschaffen/greifft manchem dieff in Seckel ond in das Gehirn. So ist nun Mercurius ein zaͤhschleimiche Wassersklebt doch nichtl Dann es ist truckner Natur / feucht warml es ist Wasser mit Erden ganz vest onzertrennlich vermenget / also das sie entweder bey einander verbleiben oder mit einander verschwinden. 2. Specul. alchim. sagi Mercurius: istlebendig Gold fol. 23. ercoͤdtet vnd machet lebendig feuchtet vund truͤcknet / waͤrmet ond kuͤhtet wuͤrcket widerwertige Ding nach der Maß seines Regimente. 3. Heisset auch Essig soli, ein Vatter aller wunder Dingi LEXICON ALCHEMIAE MART. 332 vund die hoͤchste Artzney / lebendig Silber / dieweil er ein Seei hat Item / daß Badt / ein bestaͤndig bleibendt Wasser / aqua sulphuris, ein brennendt Wasser / Wasser deß Lebens, deß Golds! deß Salniters / rein Wasser weiß Kaͤller / KaroDampffl Samen Schaten (fewrig GiffelFeiwr Ertz Kalck Azot, Gold/auripigment, Monspeichel / sputum boletorum, Citronat Safft/ vinum aminaeum, cor salis, Schein deß MeereRanderich / colla auriborites, Alaun von Apfflen /Kuhul, Straussen Magen Safft auß der Metallen Wurzel. 4. Dann er ist ein Character allei Metallen hats auch in sich ond ist heraller Gifftlreiniget das Gold. 5. Erist von deß Silbers Art desses spiritus, der weisse Steinl das flichent Wasserslac virginis, die stoltze Fraw. 6. Wann er oberhand hatlist er weiß / wann er vberwunden ist wirdter rotes ist ein maͤchtig Wasser. 7. Mercurius corporis, ist weisse Erd. 8. Exuberatus, ist die Erde deß Coͤrpers die mit dem menstruo ober den hellen gestigen ist. 9. Mercurius Martis, ist rot gelb, wie auch Mercurius Veneris. 10. Crudus Mercurius soluirt die Coͤrper/aber der Mercurius corporum thuts nicht. 11. Erist die Erde darinn man das Korn saͤhen soll. Vnd ist onuerbrennlich sentweder er bestehet gar im Fewr / oder fleucht gar hinweg-ond das ist das Zeichen seiner perfection, wann nichts im Fewer bleibt. 12. Trenes. Mercurius ist das subiectum vund materi deß Steins wann ihm deß perfecten Coͤrpers Kalck amalgamirt wirdi / druck shn durch ein leinen Tuch / ond einmal durch ein Hasenbalg wann er gar durchgehetsso ister recht. RVLANDI PHILOS. ET MEDICI. 333 13. Rosin Inser Stein bestehet in firen mercurio, der in sich hat Seel Geist ond Leib. 14. Lull. Mercurius vulgi, kan nicht sein mercurius philosophorum, er werde auch gleich bereit wie er woͤlle. 15. Bernhard. sagt: Mercurius wirdt wol onter die Metall gezehlet/aber er ist das Mittel die tincturen zuvereinige / ist doch selbs nit die medicin, sonder ein Hilffdarzu-wirdigereiniget durch die sublimation, vnd gewaschen mit Saltz ond Essig. 16. Plinius: Mercurius ist das Gifft aller Metallen, ja aller Dinger frischt ond zerreisset die Geschirm / alles schwimmet in ihme empor ohne das Gold / ond dasselbig zeucht er zu sich ond reinigete die faeces fuͤhret er mit sich durchs Leder sond laͤst das Geldt rein. 17. Alanus Mercurii ist ess. sulphuris & terrae. 18. Theophrastus, Mercurius wirdt gehaͤrtet durch die sulphura deß Metallen / vu wirde in dieselbige Natur verwandletmit dessen sulphure er gehaͤrtet worden. 19. Mercurius auß dem Coͤrper gezogen) durch die solution, distillation, sublimation und subtiliation, wirdt ein tinctur Mercurii Solis, ist fluͤchtig hat dannoch Krafft zu figiren, vnd schwaͤrtzet nicht, wie der gemeine Mercurius. 20. Allhie mustu wissen zu vnterscheiden was von mercurio, in genere & in specie geredt sey, von mercurio vulgi vnd nostro, so wirdt dirs eitel Warheit sein laß dich nur nitirr machen.', 'type': 'translation', 'xml_lang': 'de'}],
       dtype=object)}
