[{'def': 'de Phompholige & eius speciebus Diosc', 'entry_id': 'Ruland1612-Pompholix', 'raw': 'de Phompholige & eius speciebus Diosc. l. 5. c. 41. coniungit, quasi Pompholigen, spodon & antispodon. Primum Pompholix est idem, quod in pharmocopoliis iam dicitur nil album, vel nihili nichtes. Vnde prouerbium ortum, RVLANDI PHIL. ET MEDICI. 377 Nichtes ist in die Augen gut. Vocant & album pompholigu crasse. E contra spodium est idem quod in pharmacopoliis dicunt nigram pompholigem, seu nilgrysium. Ab Auicenna vocatur, ni fallor, succudus. Tertio antispodion, quod loco spodii vspurpatur, est cinis qui fit ex foliis, florib. & baccis immaturis, stipticis myrti, vel & termite syluestris oliuae & aliis, sicut docet loco citato Diosc. & Pl. l. 34. cap. 73. Nota a: quod neque spodon, neque antispodon iam nostrum praebebis alicui in os: quia vere nescimus quid sint, & vnde nostro tempore fiant. Sed accedamus ad res ipsas. Pomphilix est cinis metallicus, qui fit in summitate aut parietibus fornacum seu domuncularum, vbi sunt fornaces, in den Huͤtten, exstinctis fauillis, qui cinis & differ…', 'sense_idx': 1, 'translations': array([{'quote': 'Nichtes ist in die Augen gut', 'type': 'translation', 'xml_lang': 'de'}],
       dtype=object)}
 {'def': '1', 'entry_id': 'Ruland1612-Pompholix', 'raw': '1. Pompholix vera in officinis nil album ex Cadmia inspersa de industria. ex ipsa Cadmia pflata follibus. 25. podium 1. Fauilla & cinis me tallicus & stercus que de quo hic agitur, in officinis vocatur nil griseum. Cuiusspecies & Plin. enumerat. ab Arabibuslucia appellatur: quaeetiam apud eosdem est duplex. Natiua inlittoribus maris. Indiae. 1. alba 2. viridis 3. citrina. factitia Arabica que est spodium &no botryites illa Cadmia Alexandrina solida, quae est Cadmia illa botryites Alexandrina. 2. De cannae radice 3. Ex ebore Ex ossibus. 3. Antispodium ex cauliculis stipticis secundum Diosc. Elephanti Canum & aliorum animalium', 'sense_idx': 1, 'translations': array([], dtype=object)}
 {'def': '& tutia & spodius, vnum & idem', 'entry_id': 'Ruland1612-Pompholix', 'raw': '& tutia & spodius, vnum & idem.', 'sense_idx': 1, 'translations': array([], dtype=object)}]

