[{'def': 'arsenicum luteum', 'entry_id': 'Ruland1612-Auripigmentum', 'raw': ', arsenicum luteum: a Germanis, GoldgelbOperment/ Huͤttenrauch vocatur: pictores vti solent. Natiuum metallicum est, quod in iisdem metallis, in quibus nascitur, sandaraca reperitur, vt Dioscorides docet l. 5. c. 70. Est crustosum, aureo colore micans. Estque adfine quoddam sulphuri, ex simili materia, & odore. Estque sterquilinium terrestre (vt ita dicam) in cauernis terrae, quod per longam decoctionem transit in substantiam auripigmenti. Huius altera species fissilis est in squamas, qualis in Mysia Helesponti nascitur. Altera est pallida, glebosa, glandis effigie, colore imitatur sandaracam, quae defertur ex Ponto, & Cappadocia. Arabes natiuum auripigmentum speculari lapidi simiSed lapis le esse dicunt, scilicet respicientes ad crustas. specularis ipsam pinguedinem non habet. Miscent autem iidem Arabes sandaracam cum Arsenico, & confundunt, atque vno nomine hoc sc. Arsenico, vtrumque ad sandaracam, & auripigmentum censent, solo vero colore distinguunt: nec medici solum, sed & Chymis…', 'sense_idx': 1, 'translations': array([{'quote': 'GoldgelbOperment/ Huͤttenrauch', 'type': 'translation', 'xml_lang': 'de'}],
