 {'def': 'est coagulum specificum, quod est essentiale, chymicum, vt sit', 'entry_id': 'Ruland1612-Bolus', 'raw': 'est coagulum specificum, quod est essentiale, chymicum, vt sit 105 RVLANDI PHILOS. ET MEDICI. vt sit essentia quaedam liberata ab impuris, & alienitatibus per coagulationis, quam necessario antecedit solutio, modum segregata, constitutaque, quomodo solent boli eluti in specie fieri, vt sit eis consistentia, & forma homogenea, qualis est bolaris, nouumque etiam tabulis, id quod ad essentiam parum interest. 1. Bolus candidus Iuliacensis, ex luteo, ad quandam rubedinem accedens: vero bolo Armenio non dissimilis Iuliacensis. 2. Pannonicus verus, Vnger scher rechter bolus. 3. Luteus Theophrasti. 4. Bohemicus, & albus, & rubeus, inuentore Rudolpho II. 5. Annebergius, gebirgischer bolus. 6. Armenius verus, quem in magno pretio habet Turcicus 10 Imperator. Vtuntur eo Turci contra febres, pestem & anginam.', 'sense_idx': 1, 'translations': array([], dtype=object)}]

