 {'def': 'est prolectatio, qua essentia extrahit forma liquoris, & coagulata defertur per stillicidium, translata à vase materiae in excipulum deorsum locatum. Quod itaque destillandum est, resolubile in consistentiam humidam esse, necesse est, aut cum humore esse, siue is conatus sit, siue foris adiectus: Sunt autem talia maxime vaporosa, & quam spiritus oleosos habent. Vnde si destillanda per naturam non sunt talia, per artem esto sunt deducenda. Et est inuenta destillatio, essentiae extrahendae gratia principaliter, quanquam & famuletur abstractionib. depurationib. & similibus.', 'entry_id': 'Ruland1612-Destillatio', 'raw': 'est prolectatio, qua essentia extrahit forma liquoris, & coagulata defertur per stillicidium, translata à vase materiae in excipulum deorsum locatum. Quod itaque destillandum est, resolubile in consistentiam humidam esse, necesse est, aut cum humore esse, siue is conatus sit, siue foris adiectus: Sunt autem talia maxime vaporosa, & quam spiritus oleosos habent. Vnde si destillanda per naturam non sunt talia, per artem esto sunt deducenda. Et est inuenta destillatio, essentiae extrahendae gratia principaliter, quanquam & famuletur abstractionib. depurationib. & similibus.', 'sense_idx': 1, 'translations': array([], dtype=object)}]

