[{'entry_id': 'Ruland1612-Fermentum', 'quote': 'Ferment ist Elixir, Sawrteigl Deysseul Hefell 212 LEXICON ALCHEMIAE MART. oder Vrhed wie mans neuet / macht das corpus luͤck daß auffgehetlound der spiritus Platz findet / damit es zum backen geschickt werde: Wie nun das Meel kein Hefel ist / sonder das Meel ond Wassersondder gantze Trig wird durchsaͤwer / vi eitel Hefell also ist auch allhie der lapis selbs das ferment, doch wirdt Gold und Mercurius auch terment genennet.', 'type': 'translation', 'xml_lang': 'de'}
 {'entry_id': 'Ruland1612-Fermentum', 'quote': 'sagt: Ferment weiset das Werck / sonst wirdi mehts drauß', 'type': 'translation', 'xml_lang': 'de'}
 {'entry_id': 'Ruland1612-Fermentum', 'quote': 'Sonn und Lunam in trucken Wasser das man nennet Mercurium, also das L. Theil deß Wassers halten ein theil deß perfect Coͤrpers mach 40 Tagen wirstu das corpus finden in Wasser resoluirt. Das Zeichen der vollkommenen dissolution ist die Schwaͤrtze / so oben, erscheimet /ond ist noster Mercurius, den wir nemen zum Ferment.', 'type': 'translation', 'xml_lang': 'de'}
 {'entry_id': 'Ruland1612-Fermentum', 'quote': 'Die pastam, die wir fermentiren woͤllen die ziehen wir auß den imperfecten Coͤrpern die Weisse auß Saturno vund loue, die Roͤte auß Marte vnd Venere: aber ein jeder Coͤrper soll im ferment durch sich soluirt werden.', 'type': 'translation', 'xml_lang': 'de'}
 {'entry_id': 'Ruland1612-Fermentum', 'quote': 'Zumweissenenim weiß ferment, zum rotenrotens doch kan das ret auch weiß geben', 'type': 'translation', 'xml_lang': 'de'}
 {'entry_id': 'Ruland1612-Fermentum', 'quote': 'Nach der fermentation solls zugeschlossen sein /so wirdt das Werck verricht zum weissen in 40. Tagen zum toten in 90. in einem Geschirr ond arbeit.', 'type': 'translation', 'xml_lang': 'de'}
 {'entry_id': 'Ruland1612-Fermentum', 'quote': 'Das gemeine Gold kan nicht ferment sein dann es muß einactualem; in wirckende Kraffe haben und voll Geistes sein die Krafft habensdoch wirdis auch ferment genennt ond das Silber weiß', 'type': 'translation', 'xml_lang': 'de'}]

