[{'def': 'in genere dicit occulta naturae virtus, ex qua res omnes habent incrementum, aluntur, multiplicantur, & vegetant', 'entry_id': 'Ruland1612-Iliaster', 'raw': 'in genere dicit occulta naturae virtus, ex qua res omnes habent incrementum, aluntur, multiplicantur, & vegetant: de quo lege l. de meteoricis generat. Parac. Ist eine verborgene Krafftod Tugert der Natursauß welcher alles erwaͤchst genehrt und gemehrt wirdt. Varie autem sumitur vel de elementis, vel de homine. In elementis potentia siue virtus est naturę vegetatiua, eaque quadruplex iuxta numerum elementorum, vocatur chaos.', 'sense_idx': 1, 'translations': array([{'quote': 'Ist eine verborgene Krafftod Tugert der Natursauß welcher alles erwaͤchst genehrt und gemehrt wirdt', 'type': 'translation', 'xml_lang': 'de'}],
       dtype=object)}
 {'def': 'Eliaster, Iliadum est prima rerum omnium materia e Mercurio, sale, sulphure constans, chaos', 'entry_id': 'Ruland1612-Iliaster', 'raw': 'Eliaster, Iliadum est prima rerum omnium materia e Mercurio, sale, sulphure constans, chaos: Nihil enim est in tota rerum natura, quod non ex istis tribus consistat: atque haec tria Theophrasti sunt principia, quae analysi spagyrica deprehenduntur: Nihil praeter tria inueniemus, quae singula in singulis elementis sunt. Haec tria etiam Ioan. Fernelius animaduertit in sua medicina de humido innato: Haec veteres etiam olim tradiderunt: Itaque non primus Theophr. inuenit, sed è tenebris obruta in lucem reuocauit. Quadruplex 264 LEXICON ALCHEMIAE MART. vero est iuxta 4. elementa: primus est Cahos terrae, secundus cahos aquae, tertius cahos aeris, quartus cahos ignis. Item 4. sunt hominum Iliastri concernentes longaeuam vitam.', 'sense_idx': 1, 'translations': array([], dtype=object)}]

[{'def': 'est ignitio corpora vehementiore igne in cineres conuertens', 'entry_id': 'Ruland1612-Incineratio', 'raw': 'est ignitio corpora vehementiore igne in cineres conuertens. Incinerantur autem vegetabilia & animalia: mineralia autem (chymico more loquendo) proprie non in cineres, sed calcem redigi dicuntur.', 'sense_idx': 1, 'translations': array([], dtype=object)}
