translations_all:
[{'entry_id': 'Ruland1612-Lapis-philosophicus', 'quote': 'Elixir', 'type': 'translation', 'xml_lang': 'de'}
 {'entry_id': 'Ruland1612-Lapis-philosophicus', 'quote': 'Ist ein Stein der Weisen / darmit sie die imperfect metalla verbessern / auch alle Kranckheiten vertrieben haben', 'type': 'translation', 'xml_lang': 'de'}
 {'entry_id': 'Ruland1612-Lapis-philosophicus', 'quote': 'Die Mehrung', 'type': 'translation', 'xml_lang': 'de'}
 {'entry_id': 'Ruland1612-Lapis-philosophicus', 'quote': 'Geber Die Mehrung geschicht zweyerley Weiß. 1. Daß man die solution vund coagulation widerhole. 2. Daß man werffe/auff das weisse oder rote corpus, in solcher Groͤsse / dasselbe auch elixir werde. Alß dann lego beydes in sein Wassersonnd menstruum zu soluiren, also wirdt das erste elixir im ferment dieser Tinetur. Reibe die Mediein/ond soluirs wider in ihren Mercurium, vnd coagulirs lind / vund incerirs abermal wie Wachß/ so ist schon sein corpus doppel. So du sie noch einmal soluirest vund kochest so hastu es multipliciret hundertfaͤltig / vum also fortansje oͤffter je besser. Rouil hab acht aufflwie viel Gewicht dein Mediein faͤhlt denn je kraͤfftiger es wirdt/ je mehr du must mercurii zusetzen, in der Mehrung / alß wans doppelte Krafft mehr hatsalß im Anfang nach der ersten multiplication, so thu doppel mercurii dazu. Also auch wans dreyfacher Krafft mehr hat/ wiltu die Krafft vnnd Qualitet mehren, so nimb Wasser. Wiltu aber die substantz ond quantitet mehren / so nimb sulphur, oder materiam primam lapidis, vund kochs mit dem elixir. Thomas Tolet. Den 20. Theil deß elixirs, thu vier Theil mercurii, sigillirs vund kochs im ersten Grad deß Fewers 18. Tag. Im andern Gradiz. Tag. Im dritten/10. Hievon thu wider in den Mercurium, vnnd kochß wie vor/du wirst es in 30. Tagen außmaches also zum dritten noch ehel biß sibenden Thomas de Aquino, Theil elixir, mische mit lacte virginis, thu dazu purgirenden mercurii 7. theil / mischwasche wie zuvor / trucks durch ein Tuch oder Leder / daß nur das 7. theil bleib diß figit, so hastu es sibenfaͤltig gemehret in der Krafft. Von diesem zweyten Puluerimb ein Theils thue darzu mercurii 7. Theil / Wachß drucks durch vund figir, machs sibenmal mehr/ond also fortan.', 'type': 'translation', 'xml_lang': 'de'}]

