 {'def': 'Ist der vnreine rote Coͤrper / sagt Clangor. Istoie erste schwaͤrtze wann die hinweg-ondwiderumb rotist worden so heist es abermal Laton, und ist zusamen gesetzet auß Sonn ond Mond. Also finde zwen Latones, ror ond nach der fermentation, und wann er nicht weiß wirdinst er nichter uͤn. Er wirdt aber geweisset durch sal anatron, durch das Saltz wrot ihn die Schwaͤrtze genommen wann er so langgekecht wirkt/ 302 LEXICON ALCHEMIAE MART. bis erscheintlalß Fischaugen/alß denn ist Hoffnung deß Nutzes man nennets auch amalgama. Maria sagt: wann der Laton mit alzebric verbrennet wirdt / ond das offtwider auff ihn gegossenfalso daß die Hitz vergche dann wirdt er hell / ond verwandlet in Gold.', 'entry_id': 'Ruland1612-Laton', 'raw': 'Ist der vnreine rote Coͤrper / sagt Clangor. Istoie erste schwaͤrtze wann die hinweg-ondwiderumb rotist worden so heist es abermal Laton, und ist zusamen gesetzet auß Sonn ond Mond. Also finde zwen Latones, ror ond nach der fermentation, und wann er nicht weiß wirdinst er nichter uͤn. Er wirdt aber geweisset durch sal anatron, durch das Saltz wrot ihn die Schwaͤrtze genommen wann er so langgekecht wirkt/ 302 LEXICON ALCHEMIAE MART. bis erscheintlalß Fischaugen/alß denn ist Hoffnung deß Nutzes man nennets auch amalgama. Maria sagt: wann der Laton mit alzebric verbrennet wirdt / ond das offtwider auff ihn gegossenfalso daß die Hitz vergche dann wirdt er hell / ond verwandlet in Gold.', 'sense_idx': 1, 'translations': array([{'quote': 'Ist der vnreine rote Coͤrper / sagt Clangor. Istoie erste schwaͤrtze wann die hinweg-ondwiderumb rotist worden so heist es abermal Laton, und ist zusamen gesetzet auß Sonn ond Mond. Also finde zwen Latones, ror ond nach der fermentation, und wann er nicht weiß wirdinst er nichter uͤn. Er wirdt aber geweisset durch sal anatron, durch das Saltz wrot ihn die Schwaͤrtze genommen wann er so langgekecht wirkt/ 302 LEXICON ALCHEMIAE MART. bis erscheintlalß Fischaugen/alß denn ist Hoffnung deß Nutzes man nennets auch