[{'def': 'Aliud est stannum, aliud candidum plumbeum', 'entry_id': 'Ruland1612-Stannum', 'raw': 'Aliud est stannum, aliud candidum plumbeum. Illa ergo definitio plumbei candidi, deß Ziuns, etiam apud Chymistas, non de stanno, sed de plumbo candido, vt mihi videtur, intelligenda est, cum dicunt: stannum (es soll heissen plubum candidum est metallicum album, non purum, liuidum, terreitate pauca participans ex argento viuo, puro fixo, & non fixo, claro albo, in suo manifesto. Et rubeo, in suo occulto, & de tali sulphure deficit ei sola decoctio, siue digestio. Nam si sulphur fuerit in radice coctionis, fixione pauca, participans album, albedine non pura, non superans, sed superatum cum argento viuo, secundum partem fixo, albo non puro mixto, fit inde stannum, (es soll heissen plumbum candidum) sulphur malum non bene mixtum, & congelatum, quasi leprosus aut liuidus pater coiens cum matre quasi puriore, argento viuo non admodum puro tamen, nascitur filius inde aliquo modo formosus: sed tamen non generosus, sci. plumbum candidum. Chymistae stannum semper intelligunt Zinn nostrum: & ill…', 'sense_idx': 1, 'translations': array([{'quote': 'Als wenn man onser Biey Ertz schmeltzt / das erst das da fleufl were Plinio stannum. Et hoc dicit Plinius adulterari plumbo candido, mit onserm Zin / vund wenn du ihme recht nachdenckest /so ist Stannum Plinio schier wie onser halbwerck / davon die Kannen gemacht werden / das man Halbwerck heist.', 'type': 'translation', 'xml_lang': 'de'}],
       dtype=object)}
 {'def': 'id est, Asebum, der reine Coͤrper wirdt auch Sandgenennet.', 'entry_id': 'Ruland1612-Stannum', 'raw': 'id est, Asebum, der reine Coͤrper wirdt auch Sandgenennet.', 'sense_idx': 1, 'translations': array([], dtype=object)}]

[{'def': 'Talk est materia pellucida, splendens, & clara, vnionum similitudine, tenuissimis foliis compacta, & scissilis, cuuis sunt quatuor species: alba, flaua, nigra, rubea, Kotzensilber allerhandt farb/ weißfroth gelbl schwartz.', 'entry_id': 'Ruland1612-Talcum', 'raw': 'Talk est materia pellucida, splendens, & clara, vnionum similitudine, tenuissimis foliis compacta, & scissilis, cuuis sunt quatuor species: alba, flaua, nigra, rubea, Kotzensilber allerhandt farb/ weißfroth gelbl schwartz.', 'sense_idx': 1, 'translations': array([{'quote': 'Kotzensilber allerhandt farb/ weißfroth gelbl schwartz', 'type': 'translation', 'xml_lang': 'de'}],
       dtype=object)}
 {'def': 'vox esse Arabica creditur', 'entry_id': 'Ruland1612-Talcum', 'raw': 'vox esse Arabica creditur: significans stellulas micantes, fossores metallorum Chymici ita cognominant lapidem coagmentatum ex foliolis seu squamis, qui igne perpetuo subsistit immutabilis. Horum lapidum aliqui sunt albi, densi, fragiles, vt lapis Selinitis, vel lapis specularis dictus: aliqui virescunt, qui si nimium densi fuctat, flexiles sunt, vt etiam veluti foliola complicari & conuolui queat: reperitur in fodinis Misniae. Alias exstat & alia species, quasi ex squamis composita, splendens vt stellulae. Harum squamae aquis saepenumero dissoluuntur & finduntur; quod argentum cattarium vel talcum dicitur.', 'sense_idx': 1, 'translations': array([], dtype=object)}]

