 {'entry_id': 'Ruland1612-Aurum', 'quote': 'Die Sonn gehet auff wenn der Mond zunimper vund ist in derselbigen verborgen wirdt auch darauß gezogeni vund ist zweyerley: Der Leib der Sonnen / vund Wasser der Sonnen das ist Mercurius philosophorum. Ja sie ist dreyerley Schwarz Wiiß/ond Roth', 'type': 'translation', 'xml_lang': 'de'}
