 {'entry_id': 'Ruland1612-Aurum', 'quote': 'Eins deß Goldes ist ohne Saltz daß congelirt, darum penetrirt es vnnd tingirt die: Metallen', 'type': 'translation', 'xml_lang': 'de'}
 {'entry_id': 'Ruland1612-Aurum', 'quote': 'Das gemein Gold ist todt) aber das Philosophisch hat ein Leben / ond wirdtgantz ond gar zu einem nutriment. Das gemein Gold wie es in die Menschen gehet salso gehet es wieder von ihnen', 'type': 'translation', 'xml_lang': 'de'}
 {'entry_id': 'Ruland1612-Aurum', 'quote': 'Von der Gebehrung des Goldes wissendt das da ist / ein Schwefel der ist von der Natur in das hoͤchste sublimirtwund gereiniget von allen seinen schwaͤrtzen und faecibus, vnd so hoch diaphonirt ond condirt, daß nichts sein magynter allen Metallen / daß hoͤher am Leib RVLANDI PHIL. ET MEDICI. 93 sey/oder sein koͤnne: Und es ist der sulphur auri materia prima, eins auß den dreyen ersten. So die Alchimisten diesen moͤchten finden, wir er denn ein Goldbaum / ond in seiner Wurtzel wol zu finden istssie moͤchten sich wol frewen. Deuͤ das ist der Mercurius philosophorum, der auß dem Golde wirdt/ nicht der ander der auß dem Marte oder Venere gemacht wirdt / das ist dir scrupel ires vniuersals. Nun ist der Mercurius auch beym hoͤchsten auff metallische Art separirt von allen terrestriteten ond Zufaͤlllallein in sein purum minerale corpus transmutirt, auffalle perspicuitet, das ist der Mercurius philosophorum der aurum generirt, ist das ander Stuͤck der primae materiae. Darnach ist das Saltz, daß da ist das dritte primae materiae Solis, vnd von dem Baum darauß Gold waͤchst / ond ist zum hoͤchsten crystallirt, vnd so hoch sequestrirt und depurirt von aller seiner Schaͤrffe / acerbitet, acetositet, aluminositet, vitriolitet, also das kein Anfang hat, sondern frey / in sum selbs auff das hoͤchste elucidirt, vnd die hoͤchste Berlische diaphonitet, ietzund die drey zusammen seindt.', 'type': 'translation', 'xml_lang': 'de'}
