[{'entry_id': 'Ruland1612-Spiritus', 'quote': 'Spiritus heist die innerliche Krafft/ darinnen die Naturen der Metaͤllen verborgen ligen / ond heist Mercurius die erste vund hoͤchste materi, der mitler / in daͤmpffig Ding auß Mercurio vnd Sulphure, vund wird so klarsals Threnen-darinnen lig', 'type': 'translation', 'xml_lang': 'de'}
 {'entry_id': 'Ruland1612-Spiritus', 'quote': 'Es ist ein Waͤrme die lebendig macht, vund eingirt die Erdel die damit befeuchtet wirdtsgleich wie die Feiste deß Hyoltz die in der Eschen bleibt fir bleibt wird genannt Mercurialisch Wasser Wind-Aben/onnd Seel Wasser Bluts colla auri, rohe gumma, Oliven / der Hander Ochs / rohr Wasser Saffrangebrant Eruscomposita, &c. Der Geist zeucht den Mercurium auß der Erden / vund ist doch ein Ding wanns fluͤssig ist / so heist es Geist / darnach so heistes Leib. Ist zweyerley / praeparans & tingens: Praeparans der vorbereitet solviret / ond reiniget die Coͤrper das sind die Aegyptischen Aertzt in der parabol, auß den mineris. Tingens der tingirende ist Mercurius Philosophorum, der wird durch jehnen auß den perfect Coͤrpern gezogen vum diß sind die Alexandrischen Aertzewelches die Alchymisten verbergen. Die mineralischen Spiritus taugen nichts zu der wahren Tin5. ctur sondern nur zur Sophisterey. 6. Der Spiritus ist in dem Wasser vnsichtbahr eregtsonnd treibt das Wasserigleich wie der Wind die Wolcken / vnnd Regenond ohne die Lufftistalles tod ondfaulet. Darum muß der Spiritus wider zu den Coͤrpern kommen Daͤhersigt Hermes', 'type': 'translation', 'xml_lang': 'de'}
 {'entry_id': 'Ruland1612-Spiritus', 'quote': 'der Windt hat ihn in seinem Leibgetragen. Die verkorgene Lufft die dawohne im Wasserstregt ihn mit sich vnd fuͤhrei das Wasser durch den alem bic, welches ohne den Spiritum nit geschehe. 7. Rein B. Die Lufft tregt onsern Stein auß vund eyn /onnd verbessert ihn in seinem auffond absteigen / gleich wie die Lufft alle Ding verbessert/ond Speiß gibt denn sie tregt inen Wasser vund Fewer zu / wie wir schen / daß sie die Wolcken tregt Tawond Regen bringt darmn das Fewer verborgen ist / daß er von der Erden und Schein der Sonnen in seinem auffsteigen empfangen hat. Wenn der Spiritus nicht wider in sein corpus gekracht wuͤrdeso kehme der Coͤrper nicht rider zu seiner Macht / vund Leben.', 'type': 'translation', 'xml_lang': 'de'}]

